const DotParent = styled("div")`
  display: flex;
  justify-content: center;
  height: 30px;
  align-items: center;
  opacity: 70%;

  .dot-flashing {
    position: relative;
    width: 10px;
    height: 10px;
    border-radius: 5px;
    background-color: #2570c7;
    color: #2570c7;
    animation: dotFlashing 300ms infinite linear alternate;
    animation-delay: 100ms;
  }

  .dot-flashing::before,
  .dot-flashing::after {
    content: "";
    display: inline-block;
    position: absolute;
    top: 0;
  }

  .dot-flashing::before {
    left: -15px;
    width: 10px;
    height: 10px;
    border-radius: 5px;
    background-color: #2570c7;
    color: #2570c7;
    animation: dotFlashing 300ms infinite alternate;
    animation-delay: 0s;
  }

  .dot-flashing::after {
    left: 15px;
    width: 10px;
    height: 10px;
    border-radius: 5px;
    background-color: #2570c7;
    color: #2570c7;
    animation: dotFlashing 300ms infinite alternate;
    animation-delay: 300ms;
  }

  @keyframes dotFlashing {
    0% {
      background-color: #2570c7;
    }
    50%,
    100% {
      background-color: #b4d2f4;
    }
  }
`;
